import React from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';


function Header() {
  return (
    <div className="App">
       <div class="container mt-4 ml-4">
          <div class="row">
             <div class="header">
              </div> 
          </div>
       </div>
    </div>
  );
}

export default Header;
